import React from 'react';
import '../bootstrap.min.css';

/**
 * This is rendered when a route is not found (404).
 */
export default () =>
  <div className="NotFound">
    <h1>404</h1>
    <h3>The page you were looking for is not here.</h3>
    <a href="/">Go Home</a>
  </div>;
